import React from 'react';
import styled from "styled-components";

const Wrapper = styled.div`
    display: flex;
    background-color: #EFF8F8;
    height: 100%;
    width: 100%;
`;

const Navigation = styled.div`
    width: 22%;
`
function Dashboard() {
        return (
            <Wrapper>
                <Navigation>

                </Navigation>
            </Wrapper>
        );
}

export default Dashboard;
